import axios from "axios";

const SearchResults = () => {
    const [results, setResults] = useState([]);

    axios.get("http://localhost:8080/api/links").then((response) => {
        console.log(response)
    })

    return(
        <div className="search-results">
            Search Results!
            <ul>
                {results.map(link => (
                    <li>{link}</li>
                ))}
            </ul>
        </div>
    )
}

export default SearchResults;
